e`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1681357","type":"CustomJS"},{"attributes":{"line_color":"#1f77b4","line_width":1.3,"x":{"field":"index"},"y":{"field":"linreg(C,20,2)_0_1"}},"id":"1681335","type":"Line"},{"attributes":{},"id":"1681358","type":"CrosshairTool"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"1681041"}},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"1681232","type":"Scatter"},{"attributes":{},"id":"1681113","type":"Selection"},{"attributes":{"axis":{"id":"1681200"},"coordinates":null,"group":null,"ticker":null},"id":"1681203","type":"Grid"},{"attributes":{"format":"0,0.[00]%"},"id":"1681093","type":"NumeralTickFormatter"},{"attributes":{"dimensions":"width","maintain_focus":false},"id":"1681260","type":"WheelZoomTool"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"returns_positive","transform":{"id":"1681041"}},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_long"}},"id":"1681227","type":"Scatter"},{"attributes":{"axis_label":"Volume","coordinates":null,"formatter":{"id":"1681284"},"group":null,"major_label_policy":{"id":"1681419"},"minor_tick_line_color":null,"ticker":{"id":"1681256"}},"id":"1681255","t
